import React from 'react';
import './contatti.css';
import Form from './Form';

function Contatti() {
  return (
    <div class="contatti" id="contatti" style="background: #1F292E; color: white;">
      <div class="testo-contatti">
          <div class="pre-title" style="text-align: left;">FORM</div>
          <div class="title" style="text-align: left; font-weight: 700;">Vuoi conoscere tutti i dettagli?</div>
          <p style="font-size: 20px;"><strong>Compila il form</strong> per scoprire il progetto e le nuove residenze di <strong>Manifattura Tabacchi</strong></p>
          <p style="font-size: 14px;">Sarai ricontattato da un consulente dedicato.</p>
          <div class="info">
              <span class="icona">
                  <i class="fa-solid fa-phone"></i>
              </span>
              <span>Prenota il tuo appuntamento: +39 055 06.20.103</span>
          </div>
          <div class="info">
              <span class="icona">
                  <i class="fa-solid fa-location-pin"></i>
              </span>
              <span>Firenze | Via delle Cascine, 35</span>
          </div>
      </div>
    </div>
  );
}

export default Contatti;
